/***********************************************************************************************************
Author: Shree Sagiraju
Date:	03/24/2016
Summary:
	The following changes are  made to Anthropology/ Unidentified Remains when this script is executed
		
		Delete browser key
			Missing Person Comparison             - set to string.empty

		Add browser key to
			NCIC									txtNICNumber.Text
			NAMUS									txtNumber.Text
			CODIS									txtNuclearDNANumber.Text + txtMtDNANumber.Text + txtYDNANumber.Text
			VICAP									txtVICAPNumber.Text
			NCMEC									txtNCMECNumber.Text

***************************************************************************************************************/


BEGIN TRY
--===================================================================================================================
-- Remove the browser key for Missing Person
--===================================================================================================================
--Declare local variables for processing
Declare @MissingPersonEntityId UNIQUEIDENTIFIER, 
@MissingPersonBrowserKey varchar(50)

-- Assign the values for local variables.
set @MissingPersonBrowserKey = 'string.Empty'

--Get the GUID for Missing Person entity
SELECT @MissingPersonEntityId = E.Id 
from wsCommon.Entity E
WHERE E.RDSTypeCode = 'CAN'
AND E.TableName = 'MissingPersonComparison'


--Update to the new value for Missing Person entity in Entity table
Update wsCommon.Entity 
set BrowserKey = @MissingPersonBrowserKey
where  Id = @MissingPersonEntityId


--update to the new value for Missing Person entity in EntityRelationshipDefinition table
Update wsCommon.EntityRelationshipDefinition
set BrowserKey = @MissingPersonBrowserKey
where  ChildEntityId = @MissingPersonEntityId

--===================================================================================================================
-- Add Browser key for NCIC, NAMUS, CODIS, VICAP, MCMEC
--===================================================================================================================
Declare @entityId UNIQUEIDENTIFIER, @browserKey varchar(150), @currentRecord int, @maxRecords int, @tablevalue varchar(50)

Declare @anthropology Table(RowID int not null primary key identity(1,1),TableNameValue varchar(25), BrowserKeyValue varchar(150))

set @currentRecord = 0
	
-- Insert table names and browser key values
	Insert into @anthropology
	values('NCICDatabase', 'txtNICNumber.Text'),
		  ('NaMUSDatabase', 'txtNumber.Text'),
		  ('CODISDatabase', 'txtNuclearDNANumber.Text + " - " + txtMtDNANumber.Text +  " - "  + txtYDNANumber.Text'),
		  ('VICAPDatabase', 'txtVICAPNumber.Text'),
		  ('NCMECDatabase','txtNCMECNumber.Text')

	
	SET @maxRecords = @@ROWCOUNT
		WHILE (@currentRecord < @maxRecords)
			BEGIN
				SET @currentRecord = @currentRecord + 1
	
				Select @tableValue = TableNameValue , @browserKey = BrowserKeyValue 
				from @anthropology
				where RowID = @currentRecord
	
				--Get the GUID for Missing Person entity
				SELECT @entityId = E.Id 
				from wsCommon.Entity E
				WHERE E.RDSTypeCode = 'CAN'
				AND E.TableName = @tableValue

				--Update to the new value for entity in Entity table
				Update wsCommon.Entity 
				set BrowserKey = @browserKey
				where  Id = @entityId

				--update to the new value for the entity in EntityRelationshipDefinition table
				Update wsCommon.EntityRelationshipDefinition
				set BrowserKey = @browserKey
				where  ChildEntityId = @entityId
				and ParentEntityId <> '00000000-0000-0000-0000-000000000000'

			END 
END TRY

BEGIN CATCH
	SELECT ERROR_NUMBER() AS ErrorNumber,
		ERROR_SEVERITY() AS ErrorSeverity,
		ERROR_PROCEDURE() AS ErrorProcedure,
		ERROR_LINE() AS ErrorLine,
		ERROR_MESSAGE() AS ErrorMessage
END CATCH
GO

